import styled from 'styled-components'


const Container = styled.div`
    border: 1px solid lightgray;
    border-radius: 2px;
    padding: 8px;
    margin-bottom:8px;
`;




export default class Task extends React.Component{
    render(){
        return <Container>{this.props.task.content}</Container>
    }
}
